/********************************************************************
* FUNCTION tapi_topology_network_topology_node_transfer_capacity_mro
* 
* Make read-only child nodes
* Path: /network-topology/node/transfer-capacity
* 
* INPUTS:
*     parentval == the parent struct to use for new child nodes
* 
* RETURNS:
*     error status
********************************************************************/
static status_t
    tapi_topology_network_topology_node_transfer_capacity_mro (val_value_t *parentval)
{
    status_t res = NO_ERR;
    val_value_t *childval = NULL;
    
    res = agt_add_container(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_total_potential_capacity,
        parentval,
        &childval);
    if (res != NO_ERR) {
        return res;
    }

    res = tapi_topology_network_topology_node_transfer_capacity_total_potential_capacity_mro(childval);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_add_container(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_available_capacity,
        parentval,
        &childval);
    if (res != NO_ERR) {
        return res;
    }

    res = tapi_topology_network_topology_node_transfer_capacity_available_capacity_mro(childval);
    if (res != NO_ERR) {
        return res;
    }

    /* container transfer-capacity not handled!!! */

    /* add /network-topology/node/transfer-capacity/capacity-interaction-algorithm */
    childval = agt_make_virtual_leaf(
        parentval->obj,
        y_tapi_topology_N_capacity_interaction_algorithm,
        tapi_topology_network_topology_node_transfer_capacity_capacity_interaction_algorithm_get,
        &res);
    if (childval != NULL) {
        val_add_child(childval, parentval);
    } else {
        return res;
    }

    return res;

} /* tapi_topology_network_topology_node_transfer_capacity_mro */

