/********************************************************************
* FUNCTION y_tapi_topology_init
* 
* initialize the tapi-topology server instrumentation library
* 
* INPUTS:
*    modname == requested module name
*    revision == requested version (NULL for any)
* 
* RETURNS:
*     error status
********************************************************************/
status_t y_tapi_topology_init (
    const xmlChar *modname,
    const xmlChar *revision)
{
    status_t res = NO_ERR;
    agt_profile_t *agt_profile = agt_get_profile();

    y_tapi_topology_init_static_vars();

    /* change if custom handling done */
    if (xml_strcmp(modname, y_tapi_topology_M_tapi_topology)) {
        return ERR_NCX_UNKNOWN_MODULE;
    }

    if (revision && xml_strcmp(revision, y_tapi_topology_R_tapi_topology)) {
        return ERR_NCX_WRONG_VERSION;
    }
    res = ncxmod_load_module(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_R_tapi_topology,
        &agt_profile->agt_savedevQ,
        &tapi_topology_mod);
    if (res != NO_ERR) {
        return res;
    }

    network_topology_obj = ncx_find_object(
        tapi_topology_mod,
        y_tapi_topology_N_network_topology);
    if (tapi_topology_mod == NULL) {
        return SET_ERROR(ERR_NCX_DEF_NOT_FOUND);
    }
    get_topology_details_obj = ncx_find_object(
        tapi_topology_mod,
        y_tapi_topology_N_get_topology_details);
    if (tapi_topology_mod == NULL) {
        return SET_ERROR(ERR_NCX_DEF_NOT_FOUND);
    }
    get_node_details_obj = ncx_find_object(
        tapi_topology_mod,
        y_tapi_topology_N_get_node_details);
    if (tapi_topology_mod == NULL) {
        return SET_ERROR(ERR_NCX_DEF_NOT_FOUND);
    }
    get_node_edge_point_details_obj = ncx_find_object(
        tapi_topology_mod,
        y_tapi_topology_N_get_node_edge_point_details);
    if (tapi_topology_mod == NULL) {
        return SET_ERROR(ERR_NCX_DEF_NOT_FOUND);
    }
    get_link_details_obj = ncx_find_object(
        tapi_topology_mod,
        y_tapi_topology_N_get_link_details);
    if (tapi_topology_mod == NULL) {
        return SET_ERROR(ERR_NCX_DEF_NOT_FOUND);
    }
    get_topology_list_obj = ncx_find_object(
        tapi_topology_mod,
        y_tapi_topology_N_get_topology_list);
    if (tapi_topology_mod == NULL) {
        return SET_ERROR(ERR_NCX_DEF_NOT_FOUND);
    }
    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_topology_details,
        AGT_RPC_PH_VALIDATE,
        u_tapi_topology_get_topology_details_validate);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_topology_details,
        AGT_RPC_PH_INVOKE,
        u_tapi_topology_get_topology_details_invoke);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_node_details,
        AGT_RPC_PH_VALIDATE,
        u_tapi_topology_get_node_details_validate);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_node_details,
        AGT_RPC_PH_INVOKE,
        u_tapi_topology_get_node_details_invoke);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_node_edge_point_details,
        AGT_RPC_PH_VALIDATE,
        u_tapi_topology_get_node_edge_point_details_validate);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_node_edge_point_details,
        AGT_RPC_PH_INVOKE,
        u_tapi_topology_get_node_edge_point_details_invoke);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_link_details,
        AGT_RPC_PH_VALIDATE,
        u_tapi_topology_get_link_details_validate);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_link_details,
        AGT_RPC_PH_INVOKE,
        u_tapi_topology_get_link_details_invoke);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_topology_list,
        AGT_RPC_PH_VALIDATE,
        u_tapi_topology_get_topology_list_validate);
    if (res != NO_ERR) {
        return res;
    }

    res = agt_rpc_register_method(
        y_tapi_topology_M_tapi_topology,
        y_tapi_topology_N_get_topology_list,
        AGT_RPC_PH_INVOKE,
        u_tapi_topology_get_topology_list_invoke);
    if (res != NO_ERR) {
        return res;
    }

    res = u_tapi_topology_init(modname, revision);
    return res;
} /* y_tapi_topology_init */

